    'description': 'To pierwszy przypadek zarażenia stwierdzony w Krakowie i 12 potwierdzony jak dotąd w Polsce. Mężczyzna trafił do szpitala w sobotę wieczorem. W ostatnim czasie przebywał w północnych Włoszech. Jego stan jest dobry, stabilny. [1] Szanowni Państwo, mamy 6 nowych przypadków zakażenia #koronawirus, potwierdzonych pozytywnym wynikiem testów laboratoryjnych. Potwierdzone przypadki dotyczą 3 osób z woj. mazowieckiego (Radom, Warszawa), 1 osoby z woj. małopolskiego (Kraków) i 2 osób z woj. śląskiego (Zawiercie). [2] Mamy 28 nowych przypadków zakażenia #koronawirus, potwierdzonych pozytywnym wynikiem testów laboratoryjnych. Potwierdzone przypadki dotyczą: 7 osób z woj. kujawsko-pomorskiego, 6 osób z woj. pomorskiego, 3 osób z woj. mazowieckiego, 3 osób z woj. lubelskiego, 3 osób z woj. śląskiego, 2 osób z woj. małopolskiego, 2 osób z woj. warmińsko-mazurskiego, 1 osoby z woj. opolskiego, 1 osoby z woj. zachodniopomorskiego.Pacjenci są w stanie stabilnym. [3]',
